import React, { Component } from 'react';
import Head from 'next/head';

// Market Data
import marketData from '../../data/market';

class MarketIntro extends Component {

    componentDidMount() {
        this.getMarketData();
    }

    getMarketData=()=> {
        let data = marketData;
        console.log("market data: ", data);
    }

    render() {
        return(
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" /> 
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="intro market">
                    <h1> Welcome to  <span><img src="/logo_symbol.svg" alt="Image Description" /> Marketplace</span>  </h1>
                    <p>Whether you are an aesthetic practice in search of products or services or an industry supplier serving the needs of your customers, our AR Marketplace allows you to connect any time, day or night.</p>
                </div>
            </div>
        );
    }
}

export default MarketIntro;
